scene.onHitWall(SpriteKind.Player, function (sprite, location) {
    if (Feii.isHittingTile(CollisionDirection.Bottom) && Falling > 0) {
        music.setVolume((Falling - 150) * 10)
        Falling = 0
        music.thump.playUntilDone()
        music.setVolume(20)
    }
})
controller.up.onEvent(ControllerButtonEvent.Pressed, function () {
    if (Vine_Shooting == 0) {
        if (Feii.vy == 0) {
            if (Feii.overlapsWith(Block_1) || Feii.overlapsWith(Block_2)) {
                while (Feii.overlapsWith(Block_1)) {
                    Feii.y += -1
                }
            }
            Feii.vy = -170
            Double_Jump = 0
        }
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Block, function (sprite, otherSprite) {
    Feii.vx = 0
    if (sprite.y > otherSprite.y - 20) {
        if (sprite.x < otherSprite.x) {
            while (sprite.overlapsWith(otherSprite)) {
                Feii.x += -1
            }
        } else {
            while (sprite.overlapsWith(otherSprite)) {
                Feii.x += 1
            }
        }
    } else {
        while (sprite.overlapsWith(otherSprite)) {
            Feii.y += -1
        }
        Feii.y += 1
        Feii.vy = 0
    }
})
sprites.onOverlap(SpriteKind.Stinger, SpriteKind.Player, function (sprite, otherSprite) {
    info.changeLifeBy(-1)
    Hitter = sprite
    sprite.destroy()
    Knockback()
    Target.destroy()
})
