scene.onOverlapTile(SpriteKind.Player, assets.tile`myTile4`, function (sprite, location) {
    music.baDing.play()
    Checkpoint += 1
    if (Checkpoint == 1) {
        tiles.setTileAt(tiles.getTileLocation(17, 6), assets.tile`myTile3`)
    }
    if (Checkpoint == 2) {
        tiles.setTileAt(tiles.getTileLocation(53, 13), assets.tile`myTile3`)
    }
    if (Checkpoint == 3) {
        tiles.setTileAt(tiles.getTileLocation(75, 13), assets.tile`myTile3`)
    }
    if (Checkpoint == 4) {
        tiles.setTileAt(tiles.getTileLocation(2, 21), assets.tile`myTile3`)
    }
    if (Checkpoint == 5) {
        tiles.setTileAt(tiles.getTileLocation(13, 45), assets.tile`myTile3`)
    }
    if (Checkpoint == 6) {
        tiles.setTileAt(tiles.getTileLocation(50, 74), assets.tile`myTile3`)
    }
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Player, function (sprite, otherSprite) {
    if (Math.abs(sprite.vx) == 85) {
        info.changeLifeBy(-1)
        Hitter = sprite
        Knockback()
        sprite.destroy()
    }
})
sprites.onCreated(SpriteKind.CameraGuide, function (sprite) {
    controller.moveSprite(Feii, 0, 0)
    sprite.setFlag(SpriteFlag.Invisible, true)
    sprite.setFlag(SpriteFlag.GhostThroughWalls, true)
    sprite.setPosition(Feii.x, Feii.y)
    scene.cameraFollowSprite(sprite)
    if (Door_Closed == 0) {
        sprite.follow(Closing_Door, 100)
    } else {
        if (Trapdoor_Open == 0) {
            sprite.follow(TrapDoor, 100)
        }
    }
    if (Boss_On == 2) {
        sprite.follow(Dark_Sensei, 150)
    }
})
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.Boss, function (sprite, otherSprite) {
    if (sprite == Fireball) {
        sprite.destroy()
        if (otherSprite == Krull_Lord) {
            Krull_Lord_HP.value += -1
        }
        if (otherSprite == Dark_Sensei) {
            if (Fire_Off == 3) {
                for (let index = 0; index <= 101; index++) {
                    timer.after(index / 50, function () {
                        Dark_Sensei_HP.value += -1
                    })
                }
            } else {
                Dark_Sensei_HP.value += -1
            }
        }
    }
})
scene.onOverlapTile(SpriteKind.Player, assets.tile`myTile12`, function (sprite, location) {
    Respawn()
})
sprites.onOverlap(SpriteKind.ReviveEnergy, SpriteKind.Boss, function (sprite, otherSprite) {
    sprite.destroy()
})
