sprites.onOverlap(SpriteKind.ShadowBall, SpriteKind.Player, function (sprite, otherSprite) {
    if (Rock_Fallen == 1) {
        scene.cameraFollowSprite(Feii)
        Shadow_Ball.setFlag(SpriteFlag.Invisible, false)
        Shadow_Ball.setFlag(SpriteFlag.GhostThroughWalls, false)
        sprite.destroy()
        game.showLongText("Now, you die.", DialogLayout.Bottom)
        controller.moveSprite(Feii, 50, 0)
        info.setLife(3)
        Boss_On = 2
        Dark_Sensei_HP = statusbars.create(80, 7, StatusBarKind.EnemyHealth)
        Dark_Sensei_HP.max = 100
        Dark_Sensei_HP.value = 100
        Dark_Sensei_HP.setColor(14, 11)
        Dark_Sensei_HP.setBarBorder(1, 15)
        Dark_Sensei_HP.setOffsetPadding(0, 3)
        Dark_Sensei_HP.positionDirection(CollisionDirection.Top)
    }
})
scene.onOverlapTile(SpriteKind.Other, assets.tile`myTile25`, function (sprite, location) {
    endGrappling()
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Sign, function (sprite, otherSprite) {
    if (otherSprite == Sign_1) {
        textSprite = textsprite.create("Use arrow keys to move!", 13, 2)
    }
    if (otherSprite == Sign_2) {
        textSprite = textsprite.create("Don't fall!", 13, 2)
    }
    if (otherSprite == Sign_3) {
        textSprite = textsprite.create("Light the Checkpoint!", 13, 2)
    }
    if (otherSprite == Sign_4) {
        textSprite = textsprite.create("'A' to shoot", 13, 2)
    }
    if (otherSprite == Sign_5) {
        textSprite = textsprite.create("'A' mid-air to double jump", 13, 2)
    }
    if (otherSprite == Sign_6) {
        textSprite = textsprite.create("Push the block", 13, 2)
    }
    if (otherSprite == Sign_7) {
        textSprite = textsprite.create("'B' to change element", 13, 2)
    }
    if (otherSprite == Sign_8) {
        textSprite = textsprite.create("Grapple into the distance...", 13, 2)
    }
    if (otherSprite == Sign_9) {
        textSprite = textsprite.create("'A' then arrows to  grapple", 13, 2)
    }
    if (otherSprite == Sign_10) {
        textSprite = textsprite.create("The vine can't grip on moss", 13, 2)
    }
    if (otherSprite == Sign_11) {
        textSprite = textsprite.create("Extinguish fire with water", 13, 2)
    }
    textSprite.setPosition(otherSprite.x, otherSprite.y)
    while (sprite.overlapsWith(otherSprite)) {
        pause(100)
    }
    textSprite.destroy()
})
