function DrawEnergyRight () {
    for (let index = 0; index < 25; index++) {
        timer.after(randint(0, 200), function () {
            Drawn_Energy = sprites.create(img`
                . 5 . . 
                . 6 5 6 
                6 5 6 . 
                . . 5 . 
                `, SpriteKind.ShadowEnergy)
            Drawn_Energy.setFlag(SpriteFlag.GhostThroughWalls, true)
            Drawn_Energy.setPosition(Shadow_Fire_Right.x, Shadow_Fire_Right.y)
            Drawn_Energy.x += randint(-10, 11)
            Drawn_Energy.y += randint(-10, 11)
            Drawn_Energy.z = 5
            Drawn_Energy.follow(Dark_Sensei)
        })
    }
}
