function Knockback () {
    if (info.life() > 0) {
        music.knock.play()
        Relative_vx = Hitter.vx - Feii.vx
        Relative_vy = Hitter.vy - Feii.vy
        if (Relative_vx > 0) {
            while (Feii.overlapsWith(Hitter)) {
                Feii.x += 1
                Feii.y += -1
            }
            Feii.ax += 450
        } else {
            while (Feii.overlapsWith(Hitter)) {
                Feii.x += -1
                Feii.y += -1
            }
            Feii.ax += -450
        }
        if (Relative_vy > 0) {
            Feii.ay += 450
        } else {
            Feii.ay += -450
        }
        Feii.ax += Relative_vx * 20
        Feii.ay += Relative_vy * 20
        Feii.setFlag(SpriteFlag.GhostThroughSprites, true)
        timer.after(50, function () {
            if (Feii.ax > 0) {
                Feii.ax = -200
            } else {
                Feii.ax = 200
            }
            timer.after(Math.abs(Relative_vx * 10), function () {
                Feii.ax = 0
                Feii.vx = 0
            })
            Feii.ay = 400
            timer.after(300, function () {
                Feii.setFlag(SpriteFlag.Invisible, true)
                timer.after(300, function () {
                    Feii.setFlag(SpriteFlag.Invisible, false)
                    timer.after(300, function () {
                        Feii.setFlag(SpriteFlag.Invisible, true)
                        timer.after(300, function () {
                            Feii.setFlag(SpriteFlag.Invisible, false)
                            timer.after(300, function () {
                                Feii.setFlag(SpriteFlag.Invisible, true)
                                timer.after(300, function () {
                                    Feii.setFlag(SpriteFlag.Invisible, false)
                                    timer.after(300, function () {
                                        Feii.setFlag(SpriteFlag.Invisible, true)
                                        timer.after(300, function () {
                                            Feii.setFlag(SpriteFlag.Invisible, false)
                                        })
                                    })
                                })
                            })
                        })
                    })
                })
            })
        })
        timer.after(2500, function () {
            Feii.setFlag(SpriteFlag.GhostThroughSprites, false)
        })
    }
}
