sprites.onOverlap(SpriteKind.Player, SpriteKind.Enemy, function (sprite, otherSprite) {
    if (Boss_On == 1) {
        info.changeLifeBy(-1)
        Hitter = otherSprite
        Knockback()
    } else {
        Respawn()
        if (otherSprite == Krull) {
            RespawnKrull()
        }
    }
})
sprites.onOverlap(SpriteKind.Player, SpriteKind.Boss, function (sprite, otherSprite) {
    if (Boss_On != 0 && Dark_Sensei_Powerless == 0) {
        info.changeLifeBy(-1)
        Hitter = otherSprite
        Knockback()
    }
})
