forever(function () {
    if (Player_Seen == 0) {
        Krull_Pace_Countdown += -0.1
        pause(100)
        if (Krull_Pace_Countdown <= 8 && Krull_Pace_Countdown > 0) {
            if (Krull_Pace_Countdown <= 4) {
                Krull.vx = -10
                Krull_Direction = 0
            } else {
                Krull.vx = 10
                Krull_Direction = 1
            }
        } else {
            Krull_Pace_Countdown = 8
        }
    } else {
        if (Krull.vx == 0 && Krull_Jumped == 0) {
            Krull_Jumped = 1
            Krull.vy = -120
        }
        if (Krull.isHittingTile(CollisionDirection.Bottom)) {
            Krull_Jumped = 0
        }
        if (Feii.x > Krull.x) {
            Krull.vx = 35
            Krull_Direction = 1
        } else {
            Krull.vx = -35
            Krull_Direction = 0
        }
        Krull_Pace_Countdown = 6
    }
})
