game.onUpdateInterval(3000, function () {
    Trapped_Feii_Direction = Trapped_Feii_Direction * -1
    if (Boss_On == 2) {
        if (Fire_Off != 3) {
            if (Dark_Sensei.vy == 0 && Dark_Sensei.isHittingTile(CollisionDirection.Bottom)) {
                Shadow_Attack = randint(0, 2)
                if (Shadow_Attack == 1) {
                    Shadow_Attack = 10
                    Dark_Sensei.ax = 0
                    Dark_Sensei.vx = 0
                    if (Fire_Off == 0) {
                        if (Dark_Sensei.tileKindAt(TileDirection.Center, assets.tile`myTile40`) || (Dark_Sensei.tileKindAt(TileDirection.Center, assets.tile`myTile41`) || Dark_Sensei.tileKindAt(TileDirection.Center, assets.tile`myTile3`))) {
                            DrawEnergyRight()
                        } else if (Dark_Sensei.tileKindAt(TileDirection.Center, assets.tile`myTile38`) || Dark_Sensei.tileKindAt(TileDirection.Center, assets.tile`myTile35`)) {
                            DrawEnergyLeft()
                        }
                    } else if (Fire_Off == 1) {
                        DrawEnergyRight()
                    } else if (Fire_Off == 2) {
                        DrawEnergyLeft()
                    }
                }
            }
        }
    }
})
